import React, { useState } from 'react';
import Cookies from 'universal-cookie';


const Profile = () => {
    const cookies = new Cookies();
    
    const setCookie = () => {
        let cookieData = new Date();
        cookieData.setTime(cookieData.getTime() + ( 60 * 1000));

        cookies.set('myCat', 'Pacman', { path: '/', cookieData });
        
    }
    
    const cookieData = cookies.get('myCat')// Pacman
    
    const deleteCookie = () => {
        cookies.remove('myCat', {path: '/'});
    }
    return(
        <>
            {cookieData}
        <button onClick={setCookie} className='btn btn-primary'>Set cookie</button>
        <button onClick={deleteCookie} className='btn btn-primary'>Remove cookie</button>
        </>
    )
}

export default Profile;
